import axios from "axios";
import { useState } from "react";

export const loadPosts = (page) => async () => {
    try {
        
        const res = await axios.get(`https://dev.api.codekitten.vn/api/v1/project/search?name=%20&page=${page}`) 
        const responseBody = res.data.data.data;
        console.log(responseBody); 
        const id =  responseBody[0].created_by;
        console.log(id);

    } catch (error) {
        console.error();

    }
}
